import XCTest
import SwiftyJSON
import SwiftHTTP
@testable import DepositBeverage

class DepositVCTests: XCTestCase {
    
    let urlString = "http://www.arcadecarrent.com/mm/"
    
    override func setUp() {
        super.setUp()
        // Put setup code here. This method is called before the invocation of each test method in the class.
    }
    
    override func tearDown() {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
        super.tearDown()
    }
    
    //Test deposited list data
    func testGetDepositBeverageList() {
        let expectation = self.expectation(description: "Request should succeed")
        
        let param = [
            "userID": "1"
        ]
        
        apiRequest().depositListRequest(param as Dictionary<NSString, NSString>) { (result) in
            print(result)
            XCTAssert(result["response_rows"].int != 0, "should return list of deposit beverage")
            expectation.fulfill()
        }
        
        waitForExpectations(timeout: 30, handler: nil)
    }
    
    //Test deposit beverage successful
    func testDepositBeverage() {
        let expectation = self.expectation(description: "Deposit request should sent to server")
        
        let param = [
            "userID": "1",
            "shopID": "1",
            "tableID": "1",
            "image": "data:image/png;base64,"
        ]
        
        apiRequest().depositRequest(param as Dictionary<NSString, NSString>) { (result) in
            print(result)
            XCTAssert(result["response_status"].boolValue == true, "should return true")
            expectation.fulfill()
        }
        
        waitForExpectations(timeout: 30, handler: nil)
    }
    
    //Test fail to deposit beverage
    func testDepositBeverageFail() {
        let expectation = self.expectation(description: "Deposit request should sent to server")
        
        let param = [
            "userID": "1",
            "shopID": "1",
            "tableID": "",
            "image": ""
        ]
        
        apiRequest().depositRequest(param as Dictionary<NSString, NSString>) { (result) in
            print(result)
            XCTAssert(result["response_status"].boolValue == false, "should return false")
            expectation.fulfill()
        }
        
        waitForExpectations(timeout: 30, handler: nil)
    }
    
}
